export const UrlLists = ({ data }) => {
  const handleCopyUrl = (item) => {
    console.log(item);
  };
  return (
    <>
      {data && data?.length > 0 &&
        data?.map((item) => (
          <div className="url-static-container">
            <div className="url-static-sub-container">
              <div className="url-original">
                <p>{item?.original_link}</p>
              </div>
              <div className="url-actions-div">
                <p>{item?.short_link}</p>
                <button
                  className="btn-shortner copy"
                  onClick={(item) => handleCopyUrl(item)}
                >
                  Copy
                </button>
              </div>
            </div>
          </div>
        ))}
    </>
  );
};
